var artifactId = Get<Guid>("SrmArtifact");
var recordId = Get<Guid>("SrmRecordId");
var connectionColumnUId = Get<Guid>("SrmConnectionColumnUId");

if (!Guid.Empty.Equals(artifactId))
{
	var schema = UserConnection.EntitySchemaManager.GetInstanceByName(nameof(SrmArtifact));
	var connectionColumn = schema.Columns.GetByUId(connectionColumnUId);
	var artifact = schema.CreateEntity(UserConnection);

	if (artifact.FetchFromDB(artifactId))
	{
		artifact.SetColumnValue(connectionColumn.ColumnValueName, recordId);
		artifact.Save(false);
	}
}

return true;
